import React from 'react';
import { FormControlLabel, Checkbox } from '@mui/material';

const OrderStatus = ({ status, isSorted, onSortChange }) => {
  const handleSortChange = (e) => {
    onSortChange(e.target.checked);
  };

  return (
    <div>
      <div>{status}</div>
      <FormControlLabel
        control={<Checkbox checked={isSorted || false} onChange={handleSortChange} />}
        label="Сортировка по статусу"
      />
    </div>
  );
};

export default OrderStatus;
